import React from "react";
import Form from "./components/form.js";

function App() {
  const style = {
    color: "cornflowerblue",
    margin: 15
  }
  const forChild = {
    title: "'Sup, Planet Earth?"
  }
  return (
    <div>
      <Form fromParent={forChild.title}/>
    </div>
  )
}

export default App;
